import * as React from 'react';
import { Admin, Resource, ListGuesser } from 'react-admin';
import jsonServerProvider from 'ra-data-json-server';
import fakeDataProvider from 'ra-data-fakerest';

// const dataProvider = jsonServerProvider('http://localhost:8000');

const dataProvider = fakeDataProvider({
  cards: [
    {
      id: 0,
      header: 'Какая планета земля от солнца?',
      body: 'Земля - это 3-ая планета от солнца',
      url: 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/Earth_Eastern_Hemisphere.jpg/1024px-Earth_Eastern_Hemisphere.jpg',
    },
  ],
});

const AdminPanel: React.FC = () => {
  return (
    <Admin dataProvider={dataProvider}>
      <Resource name="cards" list={ListGuesser} />
    </Admin>
  );
};

export default AdminPanel;
